org 36000

     ld (stack),sp

     ld a,71             ; white ink (7) on black paper (0),
                           ; bright (64).
     ld (23693),a        ; set our screen colours.
     xor a               ; quick way to load accumulator with zero.
     call 8859           ; set permanent border colours.
     call 3503           ; ROM routine - clears screen, opens chan 2.

     ;di


start:
     ld ix, wave
     ld hl, 59
     ld (swingloop),hl

reset:
     ld hl, 32
     ld (frame),hl
main:




     ;jp starstart


     ld e, (ix)
     inc ix
     ld d, (ix)
     inc ix


     ld h,d              ; use ex to swap?
     ld l,e

     ld (hl),7           ;erase
     ld  de, 32
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),63
     add hl,de           ;find next line
     ld (hl),7
     
     ld a,(frame)
     dec a
     ld (frame),a
     jp nz, main

     jp starstart

nextcharacter:

     ld a,(bitnumber)    ; bitnumber 0-7
     dec a
     ld (bitnumber),a
     jp z, getnewcharacter
     jp continuecharacter
getnewcharacter:
     ld de,(charnum)
     ld hl, message
     add hl,de
     inc de
     ld (charnum),de
     ld a, (hl)
     ld (character),a
     or a
     jp nz, nextchar
     xor a
     ld (charnum),a
nextchar:
     ld a, (character)
     rst 16
     ld a,7
     ld (bitnumber),a

continuecharacter:

     ld hl, (scrollerstart)
     inc hl
     ld (scrollerstart),hl
     ld a, (character)
     rla
     ld (character),a
     and 64
     ld (hl),a





     ld (character),a
     jr c, zero
     ld (hl),255
     jp next
zero:
     ld (hl),0
next:





starstart:


starmain:

     ld hl, (starframe)
     xor a

     rept 80

     ld d, (hl)
     inc hl
     ld e, (hl)
     inc hl
     inc hl
     ex de, hl
     ld (hl),a
     ex de, hl

     endm

     ld a,(hl)
     or a
     jp nz, nxt

     ld hl, stars

nxt: ld (starframe),hl

     ld hl, (starframe)

     rept 80

     ld d, (hl)
     inc hl
     ld e, (hl)
     inc hl
     ld a, (hl)
     inc hl
     ex  de, hl
     ld (hl),a
     ex  de, hl

     endm
     

     halt




     ; http://webpages.charter.net/dawill/tmoranwms/Elec_Z80.html









     ld a,(swingloop)
     dec a
     ld (swingloop),a
     jp nz, reset

     jp start

     ld sp,(stack)
     ei
     ret


